ded and updated in the patient_x2019_s chart.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',215,1,-1,7,40,'Health History, No Change','','<NTEMPL><TEXT VALUE=\"Before dental treatment_x002C_ the patient was asked about changes to their medical history such as a recent surgery or changes in medication. Patient confirmed verbally that there have been NO changes in their medical history.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',216,1,-1,8,10,'Orthodontic Extraction','','<NTEMPL><TEXT VALUE=\"The following teeth were extracted for orthodontic purposes: _x007E_146_x007E_. A letter from the orthodontist instructed that the teeth be extracted.\" /><PROMPT><I VALUE=\"146\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',217,1,-1,8,20,'Orthodontic Referral','','<NTEMPL><TEXT VALUE=\"Patient has been given an orthodontic referral to discuss options with_x002C_ and seek treatment from an orthodontist for correction of _x007E_78_x007E_.\" /><PROMPT><I VALUE=\"78\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',218,1,-1,9,20,'Pain, No Swelling','','<NTEMPL><TEXT VALUE=\"Patient experiences pain but has no swelling in the _x007E_116_x007E_ quadrant. The pain seems to be associated with tooth _x007E_148_x007E_.\" /><PROMPT><I VALUE=\"116\" /><I VALUE=\"148\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',219,1,-1,9,30,'Pain, Swelling','','<NTEMPL><TEXT VALUE=\"Patient complains of pain and swelling in the _x007E_116_x007E_ quadrant. The swelling is located near the _x007E_141_x007E_ surface of tooth _x007E_147_x007E_.\" /><PROMPT><I VALUE=\"116\" /><I VALUE=\"147\" /><I VALUE=\"141\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',220,1,-1,9,50,'TMJ Joint Problem','','<NTEMPL><TEXT VALUE=\"Patient complained of pain in the following joint_x0028_s_x0029_: _x007E_143_x007E_.\" /><PROMPT><I VALUE=\"143\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',221,1,-1,9,60,'Ulcers in Mouth','','<NTEMPL><TEXT VALUE=\"The patient complained of pain in the oral cavity. An examination revealed the presence of an ulcerated_x002C_ white_x002C_ circular lesion of _x007E_128_x007E_ in diameter_x002C_ on the mucosa in the _x007E_116_x007E_ quadrant_x002C_ on the _x007E_141_x007E_ surface adjacent to tooth _x007E_147_x007E_.\" /><PROMPT><I VALUE=\"128\" /><I VALUE=\"116\" /><I VALUE=\"147\" /><I VALUE=\"141\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',223,1,-1,10,0,'Severe Pulpal Exposure','','<NTEMPL><TEXT VALUE=\"Examination revealed that tooth _x007E_147_x007E_ had a severe pulpal exposure. Options were discussed_x002C_ and the patient_x0027_s family chose to have the tooth extracted.\" /><PROMPT><I VALUE=\"147\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',224,1,-1,11,10,'Deep Root Scaling, Quadrant(s)','','<NTEMPL><TEXT VALUE=\"Deep root scaling was used to remove deep calculus from the teeth in the _x007E_114_x007E_ quadrant_x0028_s_x0029_ of the mouth. Patient rinsed with _x007E_77_x007E_ after treatment.\" /><PROMPT><I VALUE=\"114\" /><I VALUE=\"77\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',225,1,-1,11,20,'Deep Root Scaling, Teeth','','<NTEMPL><TEXT VALUE=\"Deep root scaling was used to remove deep calculus from the following teeth: _x007E_146_x007E_. Patient rinsed with _x007E_77_x007E_ after treatment.\" /><PROMPT><I VALUE=\"146\" /><I VALUE=\"77\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',226,1,-1,11,40,'Referral to Periodontist','','<NTEMPL><TEXT VALUE=\"Patient has been referred to a periodontist for further treatment.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',227,1,-1,12,10,'No Medication or Antibiotic','','<NTEMPL><TEXT VALUE=\"Neither pain medication nor antibiotics were given to the patient. The patient understood that their procedure was minor and did not require the use of either pain medication or antibiotics.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',228,1,-1,12,20,'Prescription','','<NTEMPL><TEXT VALUE=\"The patient has been given the following prescription:_x000A__x007E_120_x007E__x002C_ _x007E_121_x007E__x003B_ _x007E_123_x007E_. There are _x007E_122_x007E_ refills on the prescription. Prescription instructions have been given to the patient and the patient has confirmed that they understand the instructions.\" /><PROMPT><I VALUE=\"120\" /><I VALUE=\"121\" /><I VALUE=\"123\" /><I VALUE=\"122\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',230,1,-1,12,30,'Prescription to Pharmacy','','<NTEMPL><TEXT VALUE=\"The patient_x0027_s prescription was _x007E_124_x007E_.\" /><PROMPT><I VALUE=\"124\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',233,1,-1,13,10,'Patient Referred','','<NTEMPL><TEXT VALUE=\"The patient has been referred to _x007E_84_x007E_ for _x007E_83_x007E_.\" /><PROMPT><I VALUE=\"84\" /><I VALUE=\"83\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',234,1,-1,13,20,'Patient, Consider Tx Options','','<NTEMPL><TEXT VALUE=\"The patient has been presented with several treatment options and understands that they need to schedule an appointment and return to the office for treatment when they have decided upon a treatment plan.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',235,1,-1,13,30,'Treatment Importance','','<NTEMPL><TEXT VALUE=\"The importance of making and keeping treatment appointments has been discussed. A printout of costs associated with treatment has been given to the patient. The patient understands that if they do not seek immediate dental treatment the costs of restoring their dentition could increase significantly and may or may not include additional procedures such as root canals and crowns.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',236,1,-1,14,10,'Add Multiple Teeth, Removable','','<NTEMPL><TEXT VALUE=\"Additional teeth have been added to the patient_x2019_s removable appliance:  _x007E_146_x007E_.\" /><PROMPT><I VALUE=\"146\" /></PROMPT></NTEMPL>'),('2015-07-30 15:33:38',237,1,-1,14,20,'Occlusal Bite Guard Delivered','','<NTEMPL><TEXT VALUE=\"An Occlusal Bite Guard was delivered to the patient. The patient has been instructed to wear the bite guard