 X-rays will not be taken because of her condition.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',245,1,-1,17,20,'Used FMX Instead of X-ray','','<NTEMPL><TEXT VALUE=\"No X-ray was taken of the patient. The most recent FMX was used instead.\" /><PROMPT/></NTEMPL>'),('2015-07-30 15:33:38',246,1,-1,17,30,'X-ray, Patient NO Permission','','<NTEMPL><TEXT VALUE=\"A thorough explanation of the benefits and risks associated with the taking of digital x-rays was verbally discussed with the patient_x002C_ including the necessity of taking an x-ray on tooth _x007E_147_x007E_. Despite my recommendations to have x-rays taken_x002C_ the patient refused to give permission to take x-rays and the patient understands the possible consequences of this action.\" /><PROMPT><I VALUE=\"147\" /></PROMPT></NTEMPL>');

