insert  into `consent`(`automodifiedtimestamp`,`consentformid`,`active`,`name`,`version`,`excludeproccode`,`_unused`,`consenttext`) values ('2015-07-30 15:33:40',3,1,'Consent for Anesthesia',1,0,'','I, the undersigned patient, hereby give my consent for the undersigned provider to administer an anesthetic prior to the dental procedure(s) or course(s) of treatment listed below in order to achieve <local or general> anesthesia. I have agreed to the use of the anesthetic(s) listed below to achieve the desired anesthesia affect. However, I understand that the desired state of anesthesia may not be achieved alone and other anesthetic procedures or drugs may be required. I consent to the use of these additional procedures and drugs.\nI understand the risks inherent in anesthesia. I have discussed these risks with the dentist and acknowledge that they include, but are not limited to: allergic reaction, infection, bleeding, phlebitis (irritation of vein), nausea, blood clots, loss of limb function, paralysis, stroke, heart attack, brain damage, or death. \nI am aware of the fact that I will not be able to drive or operate any dangerous device for at least 24 hours after the procedure. I understand that I must have someone transport me to and from the office and care for me until I am able to care for myself. \nI agree to abstain from any food or drink (except clear liquids) for at least 8 hours before the procedure(s) or course(s) of treatment. I understand that my not refraining may result in complications during or postponement of the procedure(s) or course(s) of treatment.\nI give permission for the undersigned provider and any of his/her qualified associates to administer the anesthetic. \nI have been given the opportunity to ask questions and express concerns I have about the anesthesia. The undersigned provider has answered my questions and addressed my concerns.\nI confirm that I understand this form and the information contained therein. I am a native speaker of English or have been offered the services of a qualified translator who has explained the information in my native tongue. \n'),('2015-07-30 15:33:40',5,1,'Consent for Treatment',1,0,'','I, the undersigned patient, hereby authorize the undersigned provider to perform the procedure(s) or course(s) of treatment listed below. I understand my dental condition and have discussed several treatment options with the undersigned provider. I have been given a printed copy of the procedure or treatment details and any post-op instructions. \nI understand the risks inherent in the treatment(s). I have discussed these risks with the dentist. The dentist has addressed all questions and concerns I have presented. I understand the expected results of the procedure(s) or course(s) of treatment. I understand that these results cannot be guaranteed and may not be achieved. I am aware of my right to waive treatment of any kind and I am aware of the possible consequences of non-treatment. \nI have disclosed my health history information, including allergies, reactions to medicine, diseases, and past procedures. I understand that withholding this information may affect the outcome of the procedure(s) or course(s) of treatment. \nI authorize the undersigned provider and any other qualified assistants or medical professionals to perform the procedure(s) or treatment(s) listed below. I also give my consent for these individuals to administer any needed medicine and to perform any compulsory life-saving procedures.\nI authorize any necessary life-saving procedures to be performed in the event of an emergency during the procedure(s) or course(s) of treatment. I understand that a blood transfusion may be a part of a life-saving procedure and give my consent for necessary blood work. I give my consent for the administration of any medication that may be required as a life-saving measure.\nI have discussed payment options and agreed upon a payment plan with the insurance company and with the undersigned provider.\nI confirm that I understand this form and the information contained therein. I am a native speaker of English or have been offered the services of a qualified translator who has explained the information in my native tongue. \n'),('2015-07-30 15:33:40',7,1,'Decline Treatment Consent',1,0,'','I, the undersigned patient, am refusing the procedure(s) or course(s) of treatment recommended by the undersigned provider. I understand that my decision is against the advice of the dentist. \nI am aware of and understand my dental condition and have discussed several treatment options with the dentist. I have been presented with printed information describing these procedures and the risks and benefits associated with them. \nI have been informed of and understand the risks associated with leaving my condition untreated. I am aware that my overall health may be affected by my decision. I will not hold the dentist, dental staff, or anyone associated with the dental practice responsible for changes in my overall health stemming from this condition. \nI have had the chance to ask questions and express concerns about my dental condition, the treatment options, and my refusal of treatment. The undersigned provider has answered all my questions and addressed all my concerns. I understand the full scope of the situation and am making an informed decision. \nI confirm that I understand this form and the information contained therein. I am a native speaker of English or have been offered the services of a qualified translator who has explained the information in my native tongue. \n');

