1:03:15',98,98,5,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>When you enter our office for a dental appointment, do you receive a friendly greeting from the receptionist and/or other members of the office staff?</QuestionText><DefaultResponseText>Always\nUsually\nOccasionally\nRarely\nNever\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',100,100,2,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>When you call to make or change an appointment, is the office staff polite, courteous, and helpful in finding you an available appointment date and time?</QuestionText><DefaultResponseText>Always\nUsually\nOccasionally\nRarely\nNever\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',102,102,3,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Does the dentist and assistants take an adequate amount of time to explain your proposed treatment, ensure that you understand, and take time to answer your questions?</QuestionText><DefaultResponseText>Always\nUsually\nOccasionally\nRarely\nNever\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',104,104,4,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>When you visit our office, how long do you usually wait in the reception area (after the scheduled time of your appointment) before you are seated in the dental chair?</QuestionText><DefaultResponseText>Little or no time\n1-10 minutes\n10-20 minutes\n20+ minutes\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',106,106,3,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>After being seated in the dental chair, how long do you usually wait before seeing the dentist, dental hygienist, or other staff for treatment?</QuestionText><DefaultResponseText>Little or no time\n1-10 minutes\n10-20 minutes\n20+ minutes\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',108,108,2,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>How would you rate the professionalism of the dentist(s) in our practice?</QuestionText><DefaultResponseText>Very professional\nAverage\nToo casual\nNot professional\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',110,110,2,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>How would you rate the professionalism of the dental hygienist(s) and dental assistant(s) in our practice?</QuestionText><DefaultResponseText>Very professional\nAverage\nToo casual\nNot professional\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:03:15',112,112,2,'2010-08-02',13,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>How would you rate the professionalism of the receptionist(s) and other members of the office staff?</QuestionText><DefaultResponseText>Very professional\nAverage\nToo casual\nNot professional\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2011-11-28 09:07:35',114,114,0,'2010-08-02',10,'<Question><QuestionText>Are you satisfied with the way you are treated as an individual and a patient in our dental office?</QuestionText><DefaultResponseText>2</DefaultResponseText></Question>'),('2011-11-28 09:07:35',116,116,0,'2010-08-02',7,'<Question><QuestionText>     If no, please explain:</QuestionText><DefaultResponseText>3:</DefaultResponseText></Question>'),('2011-11-28 09:07:35',118,118,0,'2010-08-02',7,'<Question><QuestionText>What can we do to make your visits with us more pleasant and enjoyable?</QuestionText><DefaultResponseText>5:</DefaultResponseText></Question>'),('2011-11-28 09:07:35',205,205,0,'2010-08-02',4,'<Question><QuestionText>Truth-in-Lending Statement</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',208,208,4,'2010-08-02',3,'<Question><QuestionText>As a condition of your treatment by this office, financial arrangements must be made in advance. The practice depends upon reimbursement from patients for the costs incurred in their care.  Financial responsibility on the part of each patient must be determined before treatment.\nAll emergency dental services and any dental services performed without previous financial arrangements must be paid for in cash at the time services are rendered.\nPatients who carry dental insurance understand that all dental services are charged directly to the patient and that he or she is personally responsible for payment of all dental services. This office will help prepare the patient\'s insurance forms and assist in making collections from insurance companies, and will credit any collections from insurance to the patient\'s account. This dental office cannot render services on the assumption that the resulting charges will be covered by insurance.\nA service charge of 1.5 % per month (18% per annum) on the unpaid balance will be charged on all accounts with a balance exceeding 60 days, unless previously written financial arrangements are agreed upon.\nI understand that the fee estimates for dental care can only be extended for a period of six months from the date of consultation.\nIn consideration for the professional services rendered to me by this practice, I agree to pay the charges for the services at the time of treatment, or within five (5) days of billing if credit is extended. I further agree that the charges for services shall be as billed unless objected to, by me, in writing, within the time payment is due. I further agree that a waiver of any breach of any time or condition hereunder shall not constitute a waiver of any further term or condition and I further agree to pay all costs and reasonable attorney fees if suit be instituted hereunder.\nI grant my permission to you or your assignee, to telephone me to discuss matters related to this form.</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',210,210,0,'2010-08-02',16,'<Question><QuestionText>Signature of guarantor of payment/responsible party:</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',212,212,1,'2010-08-02',7,'<Question><QuestionText>Relationship to Patient:</QuestionText><DefaultResponseText>1:</DefaultResponseText></Question>'),('2011-11-28 09:07:35',213,213,0,'2010-08-02',4,'<Question><QuestionText>Provider/Staff Information Form</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',220,220,2,'2010-08-02',7,'<Question><QuestionText>Name (Last, First, MI):</QuestionText><DefaultResponseText>1:</DefaultResponseText></Question>'),('2011-11-28 09:07:35',223,223,0,'2010-08-02',8,'<Question><QuestionText>Preferred System ID:</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',224,224,1,'2010-08-02',7,'<Question><QuestionText>Title:</QuestionText><DefaultResponseText>1:</DefaultResponseText></Question>'),('2015-12-01 11:48:53',225,225,4,'2010-08-02'