al practice and I are responsible for maintaining the strict confidentiality of any ID and password assigned to me; and that the dental practice is not liable for any charges, damages, or losses that may be incurred or suffered as a result of my failure to maintain confidentiality. I understand the dental practice is not liable for any harm related to the theft of my ID and password, my disclosure of my ID and password, or my authorization to allow another person or entity to access and use the dental practice web site with my ID and password. I also agree to immediately notify the dental practice of any unauthorized use of my ID or of any other need to deactivate my ID due to security concerns.</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',257,257,2,'2010-08-02',16,'<Question><QuestionText>Signature of patient, parent, or guardian:</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',259,259,1,'2010-08-02',7,'<Question><QuestionText>Relationship to Patient:</QuestionText><DefaultResponseText>1:</DefaultResponseText></Question>'),('2011-11-28 09:07:35',270,270,0,'2010-08-02',23,'<Question><QuestionText>PI-Patient Name Info</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',272,272,0,'2010-08-02',15,'<Question><QuestionText>I have read the information above regarding the secured uploading of patient information to the web site for the dental practice, and grant the dental practice permission to securely upload my patient information to the web site.</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',274,274,1,'2010-08-02',15,'<Question><QuestionText>I have read the above conditions of treatment and payment and agree to their content.</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',278,278,4,'2010-08-02',6,'<Question><QuestionText>I also understand that State and Federal laws, as well as ethical and licensure requirements impose obligations with res