0-08-02',3,'<Question><QuestionText>As a condition of treatment by this office, financial arrangements must be made in advance. The practice depends upon reimbursement from patients for the costs incurred in their care. Financial responsibility on the part of each patient must be determined before treatment.\nAll emergency dental services, or any dental services performed without previous financial arrangements, must be paid for in cash at the time services are performed unless other arrangements are made.\nPatients with dental insurance understand that all dental services are charged directly to the patient and that he or she is personally responsible for payment of all dental services. This office will help prepare the patient\'s insurance forms or assist in making collections from insurance companies and will credit any collections to the patient\'s account. However, this dental office cannot render services on the assumption that our charges will be paid by an insurance company.\nA service charge of 1½% per month (18% per annum) on the unpaid balance will be charged on all accounts exceeding 60 days, unless previously written financial arrangements are satisfied.\nI understand that any fee estimate for this dental care can only be extended for a period of six months from the date of the patient examination.\nIn consideration for the professional services rendered to me by this practice, I agree to pay the charges for the services at the time of treatment, or within five (5) days of billing if credit is extended. I further agree that the charges for services shall be as billed unless objected to, by me, in writing, within the time payment is due. I further agree that a waiver of any breach of any time or condition hereunder shall not constitute a waiver of any further term or condition and I further agree to pay all costs and reasonable attorney fees if suit be instituted hereunder.\nI grant my permission to you or your assignee, to telephone me to discuss this statement or my treatment.</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',375,375,0,'2010-08-02',39,'<Question><QuestionText>PI-Secondary Medical Ins, Brief</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',377,377,0,'2010-08-02',5,'<Question><QuestionText>Secondary Medical Insurance:</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',379,379,0,'2010-08-02',4,'<Question><QuestionText>Secondary Insurance Information</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',442,442,0,'2010-08-02',4,'<Question><QuestionText>Medical &amp; Dental History Form</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',444,444,0,'2010-08-02',23,'<Question><QuestionText>PI-Patient Name Info</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',445,445,0,'2010-08-02',3,'<Question><QuestionText>Please take a moment to let us know about your medical and dental history so we may serve you more effectively and in a way that watches out for your overall health and well-being.</QuestionText><DefaultResponseText /></Question>'),('2011-11-28 09:07:35',447,447,0,'2010-08-02',10,'<Question><QuestionText>Would you consider yourself to be in fairly good health?</QuestionText><DefaultResponseText>2</DefaultResponseText></Question>'),('2011-11-28 09:07:35',449,449,0,'2010-08-02',10,'<Question><QuestionText>Within the past year, have there been any changes in your general health?</QuestionText><DefaultResponseText>2</DefaultResponseText></Question>'),('2011-11-28 09:07:35',451,451,0,'2010-08-02',7,'<Question><QuestionText>What is the date (or approximate date) of your last medical exam?</QuestionText><DefaultResponseText>1:</DefaultResponseText></Question>'),('2011-11-28 09:07:35',453,453,0,'2010-08-02',7,'<Question><QuestionText>Your Primary Care Physician\'s name, address, &amp; phone number:</QuestionText><DefaultResponseText>1:</DefaultResponseText></Question>'),(