14:52',515,515,0,'2014-03-15',23,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:14:53',516,516,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I hereby authorize _________________________________________ to perform implant surgery upon above named patient. I have been informed that the purpose of the operation is to surgically place one or more dental implants, into supporting jawbones. In the event that extraction of a tooth is deemed advisable by _________________________________________  due to conditions visualized and determined at the time of surgery, I hereby consent to all such extractions.\nIf any unforeseen conditions should arise in the course of the operation, calling for the doctor\'s judgement or for procedures in addition to or different from those now contemplated, I further request and authorize the doctor to do whatever he may deem advisable. Further, I have been informed of other possible alternative and/or supplemental methods of treatment, if any.\nPost-operative risks of the proposed surgery include, but are not limited to: pain; restricted mouth movement for several\ndays, weeks, or longer; paraesthesia (numbness) of the jaw or gum nerves which may persist for several weeks, months, \nor in remote instances permanently; gum recession (shrinkage); temporary, or in rare instances, permanent interference \nwith phonetics (speech sounds); clicking or pain of the temporomandibular joints (jaw joints); tooth sensitivity to hot or cold for days, weeks, or on occasion several months; transient or in some instances permanent tooth mobility (looseness) in\nselected areas; food lodging between the teeth after meals requiring cleaning devices such as floss for removal; and \nunaesthetic exposure of crown margins of teeth in the surgery area.\nI further understand that if no treatment is rendered, my present condition will probably worsen in time.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:14:54',517,517,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>No guarantee, warranty, or assurance has been given to me that the proposed treatment will be successful to my complete satisfaction. Due to individual patient differences there exists a risk of failure, relapse, of infection, selective re-treatment, or worsening of my present condition despite the best of care. However, it is _________________________________________ opinion that therapy will be helpful, and that any further loss of supporting tissues or bone would occur sooner without the recommended treatment.\nI understand that long-term success requires my long-term continued performance of mechanical plaque removal (daily home care) and my availability for periodic periodontal maintenance visits (recall professional care).\nI consent to photographs of my oral and facial structures and their publication of educational and scientific purposes.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:14:55',518,518,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>BY CHECKING THIS BOX, I CERTIFY THAT I HAVE HAD AN OPPORTUNITY TO READ AND FULLY UNDERSTAND THE TERMS AND WORDS WITHIN THE ABOVE CONSENT AND THE EXPLANATION REFERRED TO OR MADE, AND THAT ALL BLANKS OR STATEMENTS REQUIRING INSERTION OR COMPLETION WERE FILLED IN AND APPLICABLE PARAGRAPHS, IF ANY, WERE STRICKEN BEFORE I SIGNED. I AM A NATIVE SPEAKER OF ENGLISH OR I HAVE BEEN OFFERED THE SERVICES OF A QUALIFIED TRANSLATOR WHO HAS EXPLANED THE INFORMATION IN MY NATIVE TONGUE.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:09',519,519,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Informed Consent, For Oral and Maxillofacial Surgery</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:09',520,520,0,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Procedure:</QuestionText><DefaultResponseText>Surgical removal of wisdom teeth or root fragments\nExtraction (removal) of tooth\n</DefaultResponseText><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:10',521,521,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>List tooth or teeth below:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:11',522,522,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Alternatives to Surgery:</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:12',523,523,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Risk to my health if these teeth are not removed include but are not limited to:\n1. INFECTION\n2. CYST OR TUMOR FORMATION\n3. PERIODONTAL (GUM) DISEASE\n4. INCREASED RISK FOR COMPLICATIONS IF REMOVAL REQUIRED AT A LATER TIME</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:13',524,524,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>POSSIBLE COMPLICATIONS WHICH MAY HAVE BEEN DISCUSSED WITH ME INCLUDE BUT ARE NOT LIMITED TO:\n1. Injury to the nerves to the lower lip and tongue causing numbness which could possibly be permanent.\n2. Bleeding and/or bruising which may be prolonged.\n3. Dry socket.\n4. Involvement of the sinus above the upper teeth.\n5. Infection.\n6. Decision to leave a small piece of root in the jaw when its removal would require extensive surgery and increased risk of complication.\n7. Injury to adjacent teeth or fillings.\n8. Unusual reaction to medications given or prescribed.\n9. Women on birth control pills should use other forms of birth control while taking antibiotics.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:14',525,525,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Additional information: (if necessary)</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:15',526,526,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I understand that a perfect result cannot always be guaranteed. If any unforeseen conditions arise during the procedure, I request and authorize the doctor to do whatever he deems advisable to correct the condition.\nI agree to cooperate completely with the doctor, and will follow post operative instructions to the best of my ability for my own comfort and safety. I have had the opportunity to ask questions concerning these procedures. I consent to the surgery as described.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:32',527,527,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Welcome to our Practice</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:33',528,528,0,'2014-03-15',21,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:34',529,529,0,'2014-03-15',31,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:35',530,530,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Whom may we thank for referring you to our practice?</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:36',531,531,0,'2014-03-15',27,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:15:37',532,532,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://w