from past dental treatment\nHad trouble getting numb\nHad any reactions to local anesthetic\nHad/have braces, orthodontic treatment\nHad your bite adjusted\nHad any teeth removed\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:03',563,563,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>If any of the checked boxes need further explanation, please describe:</QuestionText><DefaultResponseText>4:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:05',565,565,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Consent for Services and Financial Policy</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 10:46:52',566,566,1,'2015-12-01',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>As a condition of treatment by this office, financial arrangements must be made in advance. The practice depends upon reimbursement from patients for the costs incurred in their care. Financial responsibility on the part of each patient must be determined before treatment.\nAll emergency dental services, or any dental services performed without previous financial arrangements, must be paid for in cash at the time services are performed unless other arrangements are made.\nPatients with dental insurance understand that all dental services are charged directly to the patient and that he or she is personally responsible for payment of all dental services. This office will help prepare the patient\'s insurance forms or assist in making collections from insurance companies and will credit any collections to the patient\'s account. However, this dental office cannot render services on the assumption that our charges will be paid by an insurance company.\nA service charge of 1½% per month (18% per annum) on the unpaid balance will be charged on all accounts exceeding 60 days, unless previously written financial arrangements are satisfied.\nI understand that any fee estimate for this dental care can only be extended for a period of six months from the date of the patient examination.\nIn consideration for the professional services rendered to me by this practice, I agree to pay the charges for the services at the time of treatment, or within five (5) days of billing if credit is extended. I further agree that the charges for services shall be as billed unless objected to, by me, in writing, within the time payment is due. I further agree that a waiver of any breach of any time or condition hereunder shall not constitute a waiver of any further term or condition and I further agree to pay all costs and reasonable attorney fees if suit be instituted hereunder.\nI grant my permission to you or your assignee, to telephone me to discuss this statement or my treatment.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:07',567,567,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I understand the above information and agree with its contents.  This will serve as my electronic signature for the Administration Form.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:08',568,568,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>HIPAA Acknowledgement</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:09',569,569,0,'2014-03-15',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I understand that I may inspect or copy the protected health information described by this authorization.\nI understand that at any time, this authorization may be revoked, when the office that receives this authorization receives a written revocation, although that revocation will not be effective as to the disclosure of records whose release I have previously authorized, or where other action has been taken in reliance on an authorization I have signed. I understand that my health care and the payment for my healthcare will not be affected if I refuse to sign this form.\nI understand that information used or disclosed, pursuant to this authorization, could be subject to re-disclosure by the recipient and, if so, may not be subject to federal or state law protecting its confidentiality,\n</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:10',570,570,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I understand the above information and agree with its contents.  This will serve as my electronic signature for the HIPAA Disclosure Form.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:11',572,572,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Consent for Internet Communications</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>fa