aws directly or indirectly applicable that may now or hereafter govern the gathering, use, transmission, processing, receipt, reporting, disclosure, maintenance, and storage of my information, and use their best efforts to cause all persons or entities under their direction or control to comply with such laws. I agree that the dental practice has the right to monitor, retrieve, store, upload and use my information in connection with the operation of such services, and is acting on my behalf in uploading my patient information. I understand the dental practice will use commercially reasonable efforts to maintain the confidentiality of all patient information that is uploaded to the web site on my behalf. I understand the dental practice CANNOT AND DOES NOT ASSUME ANY RESPONSIBILITY FOR MY USE OR MISUSE OF PATIENT INFORMATION OR OTHER INFORMATION TRANSMITTED, MONITORED, STORED, UPLOADED OR RECEIVED USING THE SITE OR THE SERVICES.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:14',575,575,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I have read the information above regarding the secured uploading of patient information to the web site for the dental practice, and grant the dental practice permission to securely upload my patient information to the web site.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:28',576,576,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Welcome to our Practice</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:29',577,577,0,'2014-03-15',21,'<Question xmlns