2:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:47',598,598,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Do you take antibiotic premedication for your dental visits? If yes, please explain.</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',599,599,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>What is your estimate of your general health?</QuestionText><DefaultResponseText>Excellent\nGood\nFair\nPoor\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:49',600,600,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Name of physician and their specialty:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:50',601,601,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Most recent physical exam and purpose:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:51',602,602,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Describe any current medical treatment, impending surgery, or other treatment that may possibly affect your dental treatment:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:52',603,603,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>List all medications, supplements, and/or vitamins taken within the last two years:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:52',604,604,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I acknowledge that the above information is correct and I understand it is my responsibility to inform the office of any changes in my health as soon as possible.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:53',605,605,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Dental Information</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',606,606,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>How would you rate the condition of your mouth?</QuestionText><DefaultResponseText>Excellent\nGood\nFair\nPoor\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:55',607,607,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Previous Dentist name and how long you have been a patient there:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:56',608,608,0,'2014-03-15',9,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Date of most recent dental exam:</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:57',609,609,0,'2014-03-15',9,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Date of most recent dental x-rays:</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',610,610,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I routinely see my dentist every:</QuestionText><DefaultResponseText>3 mo.\n4 mo.\n6 mo.\n12 mo.\nNot routinely\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:59',611,611,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>What is your immediate concern?</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:16:59',612,612,0,'2014-03-15',11,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Are you fearful of dental treatment? How fearful, on a scale of 1 (least) to 10 (most)</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',613,613,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Personal History, Check all that apply:</QuestionText><DefaultResponseText>Had an unfavorable dental experience\nHad complications from past dental treatment\nHad trouble getting numb\nHad any reactions to local anesthetic\nHad/have braces, orthodontic treatment\nHad your bite adjusted\nHad any teeth removed\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',614,614,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Smile Characteristics, Check all that apply:</QuestionText><DefaultResponseText>Is there anything about the appearance of your teeth that you would like to change?\nHave you ever whitened (bleached) your teeth?\nHave you felt uncomfortable or self conscious about the appearance of your teeth?\nHave you been disappointed with the appearance of previous dental work?\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',615,615,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Bite and Jaw Joint, Check all that apply:</QuestionText><DefaultResponseText>You have problems with your jaw joint\nYou have any problems chewing\nYour teeth changed in the last 5 years, become shorter, thinner, or worn\nYour teeth crowding or developing spaces\nYou chew ice, bite your nails, use your teeth to hold objects, or have any other oral habits\nYou clench you teeth in the daytime or make them sore\nYou have problems with sleep or wake up with an awareness of your teeth\nYou wear or have worn a bite appliance\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',617,617,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Tooth structure, Check all that apply:</QuestionText><DefaultResponseText>Cavities within past 3 years\nThe amount of saliva in your mouth seems too little or you have difficulty swallowing any food\nYou notice or have holes (i.e. pitting, craters) on the biting surface of your teeth\nAny teeth sensitive to hot, cold, biting, sweets, or you avoid brushing any part of your mouth\nAny teeth with grooves, notches, chips, a cracked filling or pain\nFood gets caught between any teeth\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:00:05',618,618,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Gum and Bone, Check all that apply:</QuestionText><DefaultResponseText>Gums bleed when brushing or flossing\nTreated for gum disease or were told you have lost bone around your teeth\nNoticed an unpleasant taste or odor in your mouth\nHistory of periodontal disease in your family\nExperienced gum recession\nHad any teeth become loose on their own (without injury), or have difficulty eating an apple\nExperienced a burning sensation in your mouth\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:05',619,619,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>If any of the checked boxes need further explanation, please describe:</QuestionText><DefaultResponseText>4:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:07',621,621,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Consent for Services and Financial Policy</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:08',622,622,0,'2014-03-15',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>As a condition of treatment by this office, financial arrangements must be made in advance. The practice depends upon reimbursement from patients for the costs incurred in their care. Financial responsibility on the part of each patient must be determined before treatment.\nAll emergency dental services, or any dental services performed without previous financial arrangements, must be paid for in cash at the time services are performed unless other arrangements are made.\nPatients with dental insurance understand that all dental services are charged directly to the patient and that he or she is personally responsible for payment of all dental services. This office will help prepare the patient\'s insurance forms or assist in making collections from insurance companies and will credit any collections to the patient\'s account. However, this dental office cannot render services on the assumption that our charges will be paid by an insurance company.\nA service charge of 1½% per month (18% per annum) on the unpaid balance will be charged on all accounts exceeding 60 days, unless previously written financial arrangements are satisfied.\nI understand that any fee estimate for this dental care can only be extended for a period of six months from the date of the patient examination.\nIn consideration for the professional services rendered to me by this practice, I agree to pay the charges for the services at the time of treatment, or within five (5) days of billing if credit is extended. I further agree that the charges for services shall be as billed unless objected to, by me, in writing, within the time payment is due. I further agree that a waiver of any breach of any time or condition hereunder shall not constitute a waiver of any further term or condition and I further agree to pay all costs and reasonable attorney fees if suit be instituted hereunder.\nI grant my permission to you or your assignee, to telephone me to discuss this statement or my treatment.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:09',623,623,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I understand the above information and agree with its contents.  This will serve as my electronic signature for the Administration Form.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:10',624,624,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>HIPAA Acknowledgement</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:11',625,625,0,'2014-03-15',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I understand that I may inspect or copy the protected health information described by this authorization.\nI understand that at any time, this authorization may be revoked, when the office that receives this authorization receives a written revocation, although that revocation will not be effective as to the disclosure of records whose release I have previously authorized, or where other action has been taken in reliance on an authorization I have signed. I understand that my health care and the payment for my healthcare will not be affected if I refuse to sign this form.\nI understand that information used or disclosed, pursuant to this authorization, could be subject to re-disclosure by the recipient and, if so, may not be subject to federal or state law protecting its confidentiality,\n</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:12',626,626,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I understand the above information and agree with its contents.  This will serve as my electronic signature for the HIPAA Disclosure Form.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:13',628,628,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Consent for Internet Communications</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:14',629,629,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I grant my permission to the dental practice to upload and store confidential patient information (including account information, appointment information and clinical information) to the secured web site for the dental practice. I understand that, for security purposes, the site requires a user ID and password for access and use. I also understand the dental practice and I are responsible for maintaining the strict confidentiality of any ID and password assigned to me; and that the dental practice is not liable for any charges, damages, or losses that may be incurred or suffered as a result of my failure to maintain confidentiality. I understand the dental practice is not liable for any harm related to the theft of my ID and password, my disclosure of my ID and password, or my authorization to allow another person or entity to access and use the dental practice web site with my ID and password. I also agree to immediately notify the dental practice of any unauthorized use of my ID or of any other need to deactivate my ID due to security concerns.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:15',630,630,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I also understand that State and Federal laws, as well as ethical and licensure requirements impose obligations with respect to patient confidentiality that limit the ability to make use of certain services or to transmit certain information to third parties. I understand the dental practice will represent and warrant that they will, at all times during the terms of this Agreement and thereafter, comply with all laws directly or indirectly applicable that may now or hereafter govern the gathering, use, transmission, processing, receipt, reporting, disclosure, maintenance, and storage of my information, and use their best efforts to cause all persons or entities under their direction or control to comply with such laws. I agree that the dental practice has the right to monitor, retrieve, store, upload and use my information in connection with the operation of such services, and is acting on my behalf in uploading my patient information. I understand the dental practice will use commercially reasonable efforts to maintain the confidentiality of all patient information that is uploaded to the web site on my behalf. I understand the dental practice CANNOT AND DOES NOT ASSUME ANY RESPONSIBILITY FOR MY USE OR MISUSE OF PATIENT INFORMATION OR OTHER INFORMATION TRANSMITTED, MONITORED, STORED, UPLOADED OR RECEIVED USING THE SITE OR THE SERVICES.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:16',631,631,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I have read the information above regarding the secured uploading of patient information to the web site for the dental practice, and grant the dental practice permission to securely upload my patient information to the web site.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:52',632,632,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Current Patient Information</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:53',633,633,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Please let us know about your child\'s medical and dental history so we may serve you more effectively and in a manner that helps with the overall health and well-being of your child.\nWe realize that not all questions will pertain to your child.  If you have questions, please ask and we will help to better explain the question.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:54',634,634,0,'2014-03-15',23,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:54',635,635,0,'2014-03-15',24,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:55',636,636,0,'2014-03-15',25,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:12:46',637,637,1,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Who does the child live with?</QuestionText><DefaultResponseText>Mother\nFather\nGuardian\nGrandparents\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:57',638,638,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Child\'s Medical &amp; Dental History</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:58',639,639,0,'2014-03-15',10,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Within the past year have there been any changes in your child\'s general health?</QuestionText><DefaultResponseText>2</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:17:59',640,640,0,'2014-03-15',9,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>What is the approximate date of your child\'s last medical exam?</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:18:00',641,641,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Your child\'s pediatrician name and phone number:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:18:00',642,642,0,'2014-03-15',17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:18:01',643,643,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Please indicate if your child has experienced any of the following.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:12:46',644,644,1,'2014-03-15',26,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>*Pre-Med - Amox[1]\n*Pre-Med - Clind[2]\n*Pre-Med - Other[3]\nAllergies[4]\nAllergy - Aspirin[5]\nAllergy - Codeine[6]\nAllergy - Erythro[7]\nAllergy - Hay Fever[8]\nAllergy - Latex[9]\nAllergy - Other[10]\nAllergy - Penicillin[11]\nAllergy - Sulfa[12]\nAnemia[13]\nArthritis[14]\nArtificial Joints[15]\nAsthma[16]\nBlood Disease[17]\nCancer[18]\nDiabetes[19]\nDizziness[20]\nEpilepsy[21]\nExcessive Bleeding[22]\nFainting[23]\nGlaucoma[24]\nHead Injuries[25]\nHeart Disease[26]\nHeart Murmur[27]\nHepatitis[28]\nHigh Blood Pressure[29]\nHIV[30]\nJaundice[31]\nKidney Disease[