MLSchema\"><QuestionText /><DefaultResponseText>Had complications with or after dental treatment.\nCurrently under the care of a physician due to a specific condition.\nHas been seen by a cardiologist.\nBeen admitted to a hospital in the last 5 years due to a surgery or illness.\nTaking any prescription or non-prescription medications.\nTobacco use (chewing or smoking.)\nAny other conditions, diseases, etc. not listed above.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:24',708,708,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>If any of the previous questions are marked, please explain:</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:25',709,709,0,'2014-03-15',10,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Has your child been to a different dental office in the last 6 months?</QuestionText><DefaultResponseText>2</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:26',710,710,0,'2014-03-15',7,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>What was done at your child\'s last dental visit, if to a different office?</QuestionText><DefaultResponseText>1:</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:27',711,711,0,'2014-03-15',17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',712,712,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>How frequently does you child brush their teeth?</QuestionText><DefaultResponseText>3+ a day\nTwice a day\nOnce a day\nWeekly\nSeldom\nBy parent\nBy child\nBoth\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:29',713,713,0,'2014-03-15',10,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Is your child taking a fluoride supplement?</QuestionText><DefaultResponseText>2</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',714,714,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>How often does your child floss?</QuestionText><DefaultResponseText>Once daily\nOccasionally\nNever\nBy parent\nBy child\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',715,715,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Does your child do any of the following?</QuestionText><DefaultResponseText>Lip sucking/biting\nPacifier\nNail biting\nFinger/thumb sucking\nNursing/bottle\nGrinds his teeth\nSnores\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:31',716,716,0,'2014-03-15',17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:32',717,717,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Consent for Services</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:33',718,718,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>To the best of my knowledge, all of the preceding information is true and correct.  If there is any change in my child\'s health I will inform the office at my child\'s next dental appointment.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:34',719,719,0,'2014-03-15',3,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I hereby certify that I have read and understand the previous information and that it is accurate and true to the best of my knowledge.  I acknowledge that providing incorrect and/or inaccurate information has the potential of being hazardous to my child\'s health.\nI authorize the diagnosis of my child\'s dental health by means of radiographs, study models, photographs, or other diagnostic aids deemed appropriate.\nI authorize the dentist to release any information including the diagnoses and records of treatment or examination for myself and my dependent(s) to third-party insurance carriers, payors, and/or healthcare practitioners.  I authorize my insurance carrier to submit payment directly to the dentist or dental practice, to be applied to my account.\nI understand that I am financially responsible for any outstanding balance for services provided that are not fully covered by insurance and I will be billed for this remaining balance.  I consent and agree to be financially responsible for payment of all services rendered on behalf of my children/dependents.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:35',720,720,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>I have read the above conditions of treatment and payment and agree to their content.</QuestionText><DefaultResponseText /><IsRequired>true</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:17:44',721,721,1,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Relationship to Patient:</QuestionText><DefaultResponseText>Mother\nFather\nGuardian\nOther\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:37',722,722,0,'2014-03-15',17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:38',723,723,0,'2014-03-15',4,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>PEDIATRIC DENTISTRY CONSENT FOR ANXIETY REDUCING TECHNIQUES</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:39',724,724,0,'2014-03-15',5,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Please read this form carefully and ask questions about anything you do not understand.  Please check each box to identify that you understand this technique.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:39',725,725,0,'2014-03-15',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>All effort will be made to obtain the cooperation of child dental patients by the use of Tell - Show - Do with friendliness, persuasion, humor, charm, gentleness, kindness and understanding.  In some cases, further techniques are needed when providing operative care such as fillings, etc.  In order to gain cooperation, eliminate disruptive behavior or prevent a patient causing injury to themselves, it may be necessary to use other anxiety reducing techniques.\n</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:17:44',726,726,1,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',727,727,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Positive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',728,728,3,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Mouth Props/Rubber Dams: A mouth prop, or tooth pillow as we call it, is used to help support your child in keeping his/her mouth open during an operative procedure (filling, etc).  This allows him/her to relax and not worry about consciously keeping his/her mouth open for the procedure.  A rubber dam is a raincoat placed on the area to be worked on to isolate the teeth, and to prevent any debris from being swallowed or from going to the back of the throat.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',729,729,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Immobilization by the dentist:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the dentist gently holds the child\'s hands or upper body, stabilizing the child\'s head between the dentist\'s arm and body\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',730,730,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Immobilization by the assistant:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the assistant gently holds the child\'s hands and stabilizes the child\'s head and/or legs.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:52',731,731,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Relaxation Gas: Nitrous Oxide (laughing gas) and oxygen may be recommended to relax the child. This allows the child to sit in the chair longer, increases their attention span and allows the treatment to be completed in a comfortable manner for the child.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:52',732,732,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Voice Alteration: A controlled alteration (increase or decrease) of voice, tone, or pace to influence and direct the patient\'s behavior.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:46',733,733,0,'2014-03-15',1,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:47',734,734,0,'2014-03-15',1,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2014-03-15 12:19:48',735,735,0,'2014-03-15',15,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>By checking this box, I acknowledge that I have read this statement and agree to the contents. </QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:52',736,736,2,'2014-03-15',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>Relationship to patient</QuestionText><DefaultResponseText>Mother\nFather\nGuardian\nOther\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 10:40:58',737,737,0,NULL,17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 10:42:24',738,738,0,NULL,17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 10:43:40',739,739,0,NULL,17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 10:47:39',740,740,0,'2015-12-01',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>As a condition of treatment by this office, financial arrangements must be made in advance. The practice depends upon reimbursement from patients for the costs incurred in their care. Financial responsibility on the part of each patient must be determined before treatment. All emergency dental services, or any dental services performed without previous financial arrangements, must be paid for in cash at the time services are performed unless other arrangements are made.\nPatients with dental insurance understand that all dental services are charged directly to the patient and that he or she is personally responsible for payment of all dental services. This office will help prepare the patient\'s insurance forms or assist in making collections from insurance companies and will credit any collections to the patient\'s account. However, this dental office cannot render services on the assumption that our charges will be paid by an insurance company.\nA service charge of 1½% per month (18% per annum) on the unpaid balance will be charged on all accounts exceeding 60 days, unless previously written financial arrangements are satisfied.\nI understand that any fee estimate for this dental care can only be extended for a period of six months from the date of the patient examination.\nIn consideration for the professional services rendered to me by this practice, I agree to pay the charges for the services at the time of treatment, or within five (5) days of billing if credit is extended. I further agree that the charges for services shall be as billed unless objected to, by me, in writing, within the time payment is due. I further agree that a waiver of any breach of any time or condition hereunder shall not constitute a waiver of any further term or condition and I further agree to pay all costs and reasonable attorney fees if suit be instituted hereunder.\nI grant my permission to you or your assignee, to telephone me to discuss this statement or my treatment.</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 10:49:55',741,741,0,'2015-12-01',6,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>As a condition of treatment by this office, financial ar