sRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:16:44',753,753,0,NULL,17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:35:19',754,754,0,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\nPositive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:35:44',755,755,0,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\nPositive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\nMouth Props/Rubber Dams: A mouth prop, or tooth pillow as we call it, is used to help support your child in keeping his/her mouth open during an operative procedure (filling, etc).  This allows him/her to relax and not worry about consciously keeping his/her mouth open for the procedure.  A rubber dam is a raincoat placed on the area to be worked on to isolate the teeth, and to prevent any debris from being swallowed or from going to the back of the throat.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:36:02',756,756,0,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\nPositive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\nMouth Props/Rubber Dams: A mouth prop, or tooth pillow as we call it, is used to help support your child in keeping his/her mouth open during an operative procedure (filling, etc).  This allows him/her to relax and not worry about consciously keeping his/her mouth open for the procedure.  A rubber dam is a raincoat placed on the area to be worked on to isolate the teeth, and to prevent any debris from being swallowed or from going to the back of the throat.\nImmobilization by the dentist:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the dentist gently holds the child\'s hands or upper body, stabilizing the child\'s head between the dentist\'s arm and body\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:36:25',757,757,0,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\nPositive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\nMouth Props/Rubber Dams: A mouth prop, or tooth pillow as we call it, is used to help support your child in keeping his/her mouth open during an operative procedure (filling, etc).  This allows him/her to relax and not worry about consciously keeping his/her mouth open for the procedure.  A rubber dam is a raincoat placed on the area to be worked on to isolate the teeth, and to prevent any debris from being swallowed or from going to the back of the throat.\nImmobilization by the dentist:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the dentist gently holds the child\'s hands or upper body, stabilizing the child\'s head between the dentist\'s arm and body\nImmobilization by the assistant:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the assistant gently holds the child\'s hands and stabilizes the child\'s head and/or legs.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:37:05',758,758,0,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\nPositive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\nMouth Props/Rubber Dams: A mouth prop, or tooth pillow as we call it, is used to help support your child in keeping his/her mouth open during an operative procedure (filling, etc).  This allows him/her to relax and not worry about consciously keeping his/her mouth open for the procedure.  A rubber dam is a raincoat placed on the area to be worked on to isolate the teeth, and to prevent any debris from being swallowed or from going to the back of the throat.\nImmobilization by the dentist:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the dentist gently holds the child\'s hands or upper body, stabilizing the child\'s head between the dentist\'s arm and body\nImmobilization by the assistant:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the assistant gently holds the child\'s hands and stabilizes the child\'s head and/or legs.\nRelaxation Gas: Nitrous Oxide (laughing gas) an\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:38:40',759,759,0,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\nPositive reinforcement:  This technique rewards the child who displays behavior which is desirable with compliments, praise, pat on the back, or a prize.\nMouth Props/Rubber Dams: A mouth prop, or tooth pillow as we call it, is used to help support your child in keeping his/her mouth open during an operative procedure (filling, etc).  This allows him/her to relax and not worry about consciously keeping his/her mouth open for the procedure.  A rubber dam is a raincoat placed on the area to be worked on to isolate the teeth, and to prevent any debris from being swallowed or from going to the back of the throat.\nImmobilization by the dentist:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the dentist gently holds the child\'s hands or upper body, stabilizing the child\'s head between the dentist\'s arm and body\nImmobilization by the assistant:  In the event the child moves unexpectedly (possibly resulting in an unsafe situation) the assistant gently holds the child\'s hands and stabilizes the child\'s head and/or legs.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:42:51',760,760,1,'2015-12-01',14,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText /><DefaultResponseText>Tell-Show-Do:  The dentist or dental team explains to the child what is to be done using simple, kid-friendly terminology and repetition, then shows the child what is to be done by demonstrating with instruments on a model or the child\'s or the dentist\'s finger.  The procedure is then performed in the child\'s mouth as described.  Praise is used to reinforce cooperative behavior.\n</DefaultResponseText><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>'),('2015-12-01 11:54:48',761,761,0,NULL,17,'<Question xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><QuestionText>- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -</QuestionText><DefaultResponseText /><IsRequired>false</IsRequired><IsUsedInPatientInfo>false</IsUsedInPatientInfo></Question>');

